Projects may turn on the derive feature in clap and use a declarative model to define command-line arguments. (The derive feature is new to v3---users of clap v2 can use structopt , which clap_derive is based on.) For example: # // Run this binary with:
# // cd code
# // cargo run --bin grep-app -- <arguments>
# use clap::Parser;
use std::path::PathBuf; /// A very simple utility to search for a string across multiple files.
#[derive(Debug, Parser)]
#[clap(name = "grep-app", version = "0.1.0", author = "My Awesome Team")]
pub struct GrepApp { /// Suppress normal output; instead print the name of each input file from which output /// would normally have been printed. Scanning each input file stops upon first match. #[clap(long, short = 'l')] files_with_matches: bool, /// Search string search_str: String, /// Input files files: Vec<PathBuf>,
}
# # fn main() {
# GrepApp::parse();
# }
# # #[allow(dead_code)]
# const EXPECTED_HELP: &str = r#"grep-app 0.1.0
# My Awesome Team
# A very simple utility to search for a string across multiple files
# # USAGE:
# grep-app [OPTIONS] <SEARCH_STR> [FILES]...
# # ARGS:
# <SEARCH_STR> Search string
# <FILES>... Input files
# # OPTIONS:
# -h, --help Print help information
# -l, --files-with-matches Suppress normal output; instead print the name of each input file
# from which output would normally have been printed. Scanning each
# input file stops upon first match
# -V, --version Print version information
# "#;
# # #[cfg(test)]
# mod tests {
# use super::*;
# use clap::IntoApp;
# use std::io::Cursor;
# # #[test]
# fn test_help() {
# let mut app = GrepApp::into_app();
# let mut cursor: Cursor<Vec<u8>> = Cursor::new(Vec::new());
# app.write_help(&mut cursor).unwrap();
# let help = String::from_utf8(cursor.into_inner()).unwrap();
# println!("{}", help);
# assert_eq!(help, EXPECTED_HELP);
# }
# } The doc comments are processed as help text by clap. Here's what the help text looks like: # // Run this binary with:
# // cd code
# // cargo run --bin grep-app -- <arguments>
# # use clap::Parser;
# use std::path::PathBuf;
# # /// A very simple utility to search for a string across multiple files.
# #[derive(Debug, Parser)]
# #[clap(name = "grep-app", version = "0.1.0", author = "My Awesome Team")]
# pub struct GrepApp {
# /// Suppress normal output; instead print the name of each input file from which output
# /// would normally have been printed. Scanning each input file stops upon first match.
# #[clap(long, short = 'l')]
# files_with_matches: bool,
# # /// Search string
# search_str: String,
# # /// Input files
# files: Vec<PathBuf>,
# }
# # fn main() {
# GrepApp::parse();
# }
# # #[allow(dead_code)]
const EXPECTED_HELP: &str = r#"grep-app 0.1.0
My Awesome Team
A very simple utility to search for a string across multiple files USAGE: grep-app [OPTIONS] <SEARCH_STR> [FILES]... ARGS: <SEARCH_STR> Search string <FILES>... Input files OPTIONS: -h, --help Print help information -l, --files-with-matches Suppress normal output; instead print the name of each input file from which output would normally have been printed. Scanning each input file stops upon first match -V, --version Print version information
"#;
# # #[cfg(test)]
# mod tests {
# use super::*;
# use clap::IntoApp;
# use std::io::Cursor;
# # #[test]
# fn test_help() {
# let mut app = GrepApp::into_app();
# let mut cursor: Cursor<Vec<u8>> = Cursor::new(Vec::new());
# app.write_help(&mut cursor).unwrap();
# let help = String::from_utf8(cursor.into_inner()).unwrap();
# println!("{}", help);
# assert_eq!(help, EXPECTED_HELP);
# }
# } Why? Derive-style arguments are significantly easier to read, write, and modify. Derive-style components can be written once, and reused across multiple commands. Why not? The derive macro is an optional feature that pulls in extra dependencies and increases build times. The derive macro can be a bit magical. Looking at the source code of clap_derive may be useful sometimes.

